import React, {Components} from 'react';

export default class Slider extends Components{
    render(){
        return(
            <div className="b-slidercontainer">
                <div className="b-slider j-fullscreenslider ">
                    <ul>
                        <li data-transition="" data-slotamount="7">
                            
                        </li>
                    </ul>
                </div>
            </div>
            
        );
    }
}
